VALUES
	(1,'hamburger','<p>hamburger is delicious</p>','2018-02-13 14:32:14','2018-02-28 09:03:10','2018-02-12 14:32:18','2018-02-19 15:38:36',NULL,'[]',1,'hamburger',15),
	(2,'pizza','<p>pizza is delicious</p>','2018-02-27 10:14:10','2018-02-28 10:09:31','2018-02-12 14:33:13','2018-02-19 15:27:14',NULL,'[]',1,'pizza',4.6),
	(3,'kapsalon','<p><strong>Kapsalon</strong><span>&nbsp;</span>is a <a href=\"https://en.wikipedia.org/wiki/Dutch_cuisine\" title=\"Dutch cuisine\">Dutch food</a><span>&nbsp;item consisting of<span>&nbsp;</span></span><a href=\"https://en.wikipedia.org/wiki/French_fries\" title=\"French fries\">fries</a>, topped with<span>&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/D%C3%B6ner_kebab\" title=\"Döner kebab\">döner</a><span>&nbsp;</span>or <a href=\"https://en.wikipedia.org/wiki/Shawarma\" title=\"Shawarma\">shawarma</a><span>&nbsp;meat, grilled with a layer of<span>&nbsp;</span></span><a href=\"https://en.wikipedia.org/wiki/Gouda_cheese\" title=\"Gouda cheese\">Gouda cheese</a><span>&nbsp;</span>until melted and then subsequently covered with a layer of dressed <a href=\"https://en.wikipedia.org/wiki/Salad\" title=\"Salad\">salad</a><span>&nbsp;greens. The dish is usually served in a disposable metal tray as this food is a<span>&nbsp;</span></span><a href=\"https://en.wikipedia.org/wiki/Fast_food\" title=\"Fast food\">fast food</a>. The dish is often served with<span>&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Garlic_sauce\" title=\"Garlic sauce\">garlic sauce</a><span>&nbsp;</span>and <a href=\"https://en.wikipedia.org/wiki/Sambal\" title=\"Sambal\">sambal</a><span>, a&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Hot_sauce\" title=\"Hot sauce\">hot sauce</a><span>&nbsp;from the former colony of<span>&nbsp;</span></span><a href=\"https://en.wikipedia.org/wiki/Indonesia\" title=\"Indonesia\">Indonesia</a>.<span>&nbsp;</span><em>Kapsalon</em><span>&nbsp;</span>has a high energy content, with each serving containing approximately 7500 <a href=\"https://en.wikipedia.org/wiki/Kilojoule\" title=\"Kilojoule\">kJ</a><sup><a href=\"https://en.wikipedia.org/wiki/Kapsalon#cite_note-vk-1\">[1]</a></sup><span>, but apart from the high-GL fries, low in&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Carbohydrates\" title=\"Carbohydrates\">carbohydrates</a><span>&nbsp;and hence<span>&nbsp;</span></span><a href=\"https://en.wikipedia.org/wiki/Glycemic_load\" title=\"Glycemic load\">glycemic load</a><span>&nbsp;</span>(GL). The term <em>kapsalon</em><span>&nbsp;means \"</span><a href=\"https://en.wikipedia.org/wiki/Hairdresser\" title=\"Hairdresser\">hairdressing salon</a><span>\" in&nbsp;</span><a href=\"https://en.wikipedia.org/wiki/Dutch_language\" title=\"Dutch language\">Dutch</a><span>, alluding to one of the inventors&nbsp;</span></p>','2018-02-14 14:33:51','2018-02-28 14:33:54','2018-02-12 14:33:56','2018-02-19 15:27:28',NULL,'[]',1,'kapsalon',100),
	(4,'bazella w riz','<p>Combine all baharat ingredients together.</p>\r\n\r\n<p>Heat the oil and butter in a medium saucepan over medium-high heat. Add the onion and cook for 8–10 minutes until starting to turn golden. &nbsp;Add the garlic, cook for 1 minute, then add the mince and cook, breaking up lumps with the back of a spoon, for 4–5 minutes until browned. Add the 2 tsp baharat and 1 tsp salt and cook for 1 minute. Add the carrot and tomato paste, stir to combine then add the remaining 1 tsp salt and the stock. Bring to the boil, reduce the heat and simmer, covered, for 20 minutes. Remove the lid and cook for a further 4–5 minutes until the sauce thickens slightly. Stir through the peas and cook for 2 minutes. Season to taste.</p>\r\n\r\n<p>Meanwhile, to make the rice, heat the butter and oil in a heavy-based saucepan over medium-high heat. &nbsp;Add the vermicelli and fry for 3–4 minutes, stirring, until golden.</p>\r\n\r\n<p>Immediately add the water, rice, and salt. Cover, bring to a boil, reduce the heat to low and cook, covered, for 12–14 minutes or until all the water is absorbed and the rice and pasta are tender.</p>\r\n\r\n<p>Serve the stew and rice together with yoghurt on the side.</p>','2018-02-12 14:57:17','2018-02-28 10:13:48','2018-02-12 14:57:48','2018-02-19 10:13:57',NULL,'[{\"ingredient_name\":\"riz\",\"quantity\":\"1 kilo\"},{\"ingredient_name\":\"bazella\",\"quantity\":\"2 kilo\"},{\"ingredient_name\":\"\\u0645\\u0644\\u062d\",\"quantity\":\"\"}]',1,'bazella-w-riz',NULL),
	(5,'Kabsa','<p>ىهؤث</p>','2018-02-19 09:07:23',NULL,'2018-02-19 09:02:43','2018-02-19 09:07:25',NULL,'[]',1,'kabsa',NULL);

